]

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <Grid
           col={4}
           mdCol={2}
           smCol={1}
           gap={10}
        >
            <div>
              <div className="footer__title">

              </div>
            </div>
        </Grid>
      </div>
    </footer>
  )
};

export default Footer;
